import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import '../node_modules/bootstrap/dist/js/bootstrap.bundle';
// import Img1 from './img/slid1.jpg';

const ComnPage = (props) => {
  return (
    <>
      <div className="container-fluid nav-bg aboutcss">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className=" row d-flex align-items-center mt-5 mb-5 ">
              <div className=" col-md-6 pt-5 pt-lg-0 order-1 order-lg-1 d-flex justify-content-center flex-column">
                <h1 className=" mt-5"> {props.hedf} </h1>
                <h3 className="grow_business"> {props.name} </h3>
                <h5 className=" text-capitalize mb-4">we are the team of most tallented devloper</h5>
                <a href="/Servies" className="text-center get_started">Get started</a>
              </div>
              <div className="col-md-6 pt-5 pt-lg-0 order-1 order-lg-1 text-end abutimg">
                <img className=" mt-4" src='https://mybillbook.in/static-assets/images/landing-page/landing-hero-image.webp' alt="svg img"></img>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  )
};
export default ComnPage;
